import math

def identify_language(s):
    count = dict()
    for c in s:
        if c in count:
            count[c] += 1
        else:
            count[c] = 1

    mx_score = float("-inf")
    mx_lang = "English"
    for k in incidence:
        score = 0.0
        d = incidence[k]
        min_p = 1.0
        min_c = 'a'
        for c in d:
            if d[c] < min_p:
                min_p = d[c]
                min_c = c
        for c in count:
            if c in d:
                score += math.log(d[c]) * count[c]
            else:
                score += math.log(min_p) * count[c]
        if score > mx_score:
            mx_score = score
            mx_lang = k
        # print(k, score)
    return mx_lang

